class HowFunction extends React.Component {
  state = {
    value: 'functions.poetri.co/*function',
    copied: false,
    tabs
  };
  stateTwo = {
    value: 'npm i -g @poetri/cli',
    copied: false,
  };
  stateThree = {
    value: 'poetri init',
    copied: false,
  };

  verifyTab = (index) => {
    const insert = (arr, index, newItem) => [
      // part of the array before the specified index
      ...arr.slice(0, index),
      // inserted item
      newItem,
      // part of the array after the specified index
      ...arr.slice(index)
    ]

    this.setState({ tabs: insert(tabs, index + 1, myTab(this.state)) })

  }

  render() {
    return (
      <div className="section-how-function container">
        <div className="section-how-function__title" id="como-funciona">
          <h2>¿Comó funciona?</h2>
          <p>Poetri es versatilidad:</p>
          <a href="/">Ver Documentación</a>
        </div>
        <Tabs defaultIndex={-1} onSelect={this.verifyTab}>
          <TabList>
            {
              this.state.tabs.map(item => <Tab>{item}</Tab>)
            }
          </TabList>


        </Tabs>
      </div>
    )
  }
};
export default HowFunction;
